import React, { useState, useEffect } from 'react';
import { useLanguage } from '../contexts/LanguageContext';
import { GameStats } from '../types/game';
import { Difficulty } from '../types/levels';
import './VictoryPage.css';

interface VictoryPageProps {
  isVisible: boolean;
  completedLevel: Difficulty;
  finalStats: GameStats;
  onContinue: () => void;
  onMainMenu: () => void;
}

const VictoryPage: React.FC<VictoryPageProps> = ({
  isVisible,
  completedLevel,
  finalStats,
  onContinue,
  onMainMenu
}) => {
  const { language } = useLanguage();
  const [showStats, setShowStats] = useState(false);
  const [showButtons, setShowButtons] = useState(false);

  useEffect(() => {
    if (isVisible) {
      // Âª∂ÈÅ≤È°ØÁ§∫Áµ±Ë®àÂíåÊåâÈàï
      setTimeout(() => setShowStats(true), 1000);
      setTimeout(() => setShowButtons(true), 2000);
    } else {
      setShowStats(false);
      setShowButtons(false);
    }
  }, [isVisible]);

  const getLevelTitle = (level: Difficulty) => {
    const titles = {
      [Difficulty.EASY]: { zh: 'ÂàùÂøÉËÄÖÂ§ßÂ∏´', en: 'Beginner Master' },
      [Difficulty.MEDIUM]: { zh: 'ÈÄ≤ÈöéÂæÅÊúçËÄÖ', en: 'Advanced Conqueror' },
      [Difficulty.HARD]: { zh: 'Â∞àÂÆ∂Á¥öËã±ÈõÑ', en: 'Expert Hero' },
      [Difficulty.SUPER]: { zh: 'Ë∂ÖÁ¥öÂÇ≥Â•á', en: 'Super Legend' },
      [Difficulty.GOD]: { zh: 'Á•ûÁ¥öËá≥Â∞ä', en: 'Divine Master' },
    };
    return language === 'zh' ? titles[level].zh : titles[level].en;
  };

  const getLevelIcon = (level: Difficulty) => {
    const icons = {
      [Difficulty.EASY]: 'üå±',
      [Difficulty.MEDIUM]: 'üî•',
      [Difficulty.HARD]: '‚ö°',
      [Difficulty.SUPER]: 'üíé',
      [Difficulty.GOD]: 'üëë',
    };
    return icons[level];
  };

  const getVictoryMessage = (level: Difficulty) => {
    const messages = {
      [Difficulty.EASY]: {
        zh: 'ÊÅ≠Âñú‰Ω†Ë∏èÂá∫‰∫ÜÁ¨¨‰∏ÄÊ≠•ÔºÅÁπºÁ∫åÊåëÊà∞Êõ¥È´òÁöÑÈõ£Â∫¶ÂêßÔºÅ',
        en: 'Congratulations on your first step! Challenge higher difficulties!'
      },
      [Difficulty.MEDIUM]: {
        zh: '‰Ω†Â∑≤Á∂ìÊéåÊè°‰∫ÜÂü∫Êú¨ÊäÄÂ∑ßÔºÅÊ∫ñÂÇôÂ•ΩÈù¢Â∞çÊõ¥Â§ßÁöÑÊåëÊà∞‰∫ÜÂóéÔºü',
        en: 'You\'ve mastered the basics! Ready for bigger challenges?'
      },
      [Difficulty.HARD]: {
        zh: 'ÁúüÊ≠£ÁöÑÈ´òÊâãÔºÅ‰Ω†ÁöÑÁ≠ñÁï•ÊÄùÁ∂≠‰ª§‰∫∫Âç∞Ë±°Ê∑±ÂàªÔºÅ',
        en: 'A true expert! Your strategic thinking is impressive!'
      },
      [Difficulty.SUPER]: {
        zh: 'Ë∂ÖÂá°ÂÖ•ËÅñÔºÅ‰Ω†Â∑≤Á∂ìÈÅîÂà∞‰∫ÜÂÇ≥Â•áÁ¥öÂà•ÁöÑÊäÄËÉΩÔºÅ',
        en: 'Transcendent! You\'ve reached legendary skill levels!'
      },
      [Difficulty.GOD]: {
        zh: 'Á•ûÁ¥öÂ§ßÂ∏´ÔºÅ‰Ω†Â∑≤Á∂ìÂæÅÊúç‰∫ÜÊâÄÊúâÊåëÊà∞ÔºåÊàêÁÇ∫ÁúüÊ≠£ÁöÑËâ≤ÂΩ©ÈÄ£ÈéñÂèçÊáâ‰πãÁ•ûÔºÅ',
        en: 'Divine Master! You\'ve conquered all challenges and become the true God of Color Chain Reaction!'
      },
    };
    return language === 'zh' ? messages[level].zh : messages[level].en;
  };

  if (!isVisible) return null;

  return (
    <div className="victory-page-overlay">
      <div className="victory-page">
        {/* ‰∏ªË¶ÅÊÖ∂Á•ùÂçÄÂüü */}
        <div className="victory-celebration">
          <div className="victory-icon-container">
            <div className="victory-icon">{getLevelIcon(completedLevel)}</div>
            <div className="victory-crown">üëë</div>
          </div>
          
          <h1 className="victory-title">
            {completedLevel === Difficulty.GOD 
              ? (language === 'zh' ? 'üéâ YOU BEAT THE GAME! üéâ' : 'üéâ YOU BEAT THE GAME! üéâ')
              : (language === 'zh' ? 'ÊÅ≠ÂñúÈÄöÈóúÔºÅ' : 'VICTORY!')
            }
          </h1>
          
          <h2 className="victory-subtitle">
            {getLevelTitle(completedLevel)}
          </h2>
          
          {completedLevel === Difficulty.GOD && (
            <div className="ultimate-victory">
              <div className="ultimate-text">
                {language === 'zh' ? 'üèÜ ÁµÇÊ•µÂ§ßÂ∏´ üèÜ' : 'üèÜ ULTIMATE MASTER üèÜ'}
              </div>
              <div className="god-message">
                {language === 'zh' 
                  ? '‰Ω†Â∑≤Á∂ìÂæÅÊúç‰∫ÜÊâÄÊúâÊåëÊà∞ÔºåÊàêÁÇ∫ÁúüÊ≠£ÁöÑËâ≤ÂΩ©ÈÄ£ÈéñÂèçÊáâ‰πãÁ•ûÔºÅ' 
                  : 'You have conquered all challenges and become the true God of Color Chain Reaction!'
                }
              </div>
            </div>
          )}
          
          <p className="victory-message">
            {getVictoryMessage(completedLevel)}
          </p>
        </div>

        {/* Áµ±Ë®àÂ±ïÁ§∫ */}
        {showStats && (
          <div className="victory-stats-section">
            <h3 className="stats-title">
              {language === 'zh' ? 'ÈÄöÈóúÁµ±Ë®à' : 'Victory Stats'}
            </h3>
            
            <div className="victory-stats-grid">
              <div className="victory-stat-card">
                <div className="stat-icon">üéØ</div>
                <div className="stat-info">
                  <div className="stat-label">
                    {language === 'zh' ? 'ÊúÄÁµÇÂàÜÊï∏' : 'Final Score'}
                  </div>
                  <div className="stat-value score">
                    {finalStats.score.toLocaleString()}
                  </div>
                </div>
              </div>
              
              <div className="victory-stat-card">
                <div className="stat-icon">‚è∞</div>
                <div className="stat-info">
                  <div className="stat-label">
                    {language === 'zh' ? 'ÂÆåÊàêÊôÇÈñì' : 'Completion Time'}
                  </div>
                  <div className="stat-value time">
                    {Math.floor(finalStats.timeElapsed / 60)}:{(finalStats.timeElapsed % 60).toString().padStart(2, '0')}
                  </div>
                </div>
